import React from "react";
import styled from "styled-components";

const MainActivityContainer = styled.div`
  max-width: 1280px;
  margin: 0 auto;
  padding-left: 40px;
  padding-right: 40px;
  box-sizing: border-box;
`;

function MainActivity() {
  return (
    <MainActivityContainer>
      <div className="MainActivityLeft"></div>
      <div className="MainToActivity"></div>
      <div>EC에 오면 이런 활동을 할 수 있어요!</div>
      <div className="MainActivityText1"></div>
      <div className="MainActivityText2"></div>
      <div className="MainActivityPhoto"></div>
    </MainActivityContainer>
  );
}

export default MainActivity;
